import React from 'react'
import { Container, Row, Col } from 'reactstrap';
import Frexco from "./Imagem/Frexco.png"

const Headers = (props) => {
    return (
      <div>
        <Jumbotron>
          <img src={Frexco}/> 
          <h1 className="display-20" >Frexco - Controle de Estoque</h1>
                
        </Jumbotron>
      </div>
    );
  };    


export default Headers;
